// Export to CSV
export function exportToCSV(
  data: Record<string, unknown>[],
  filename: string
): void {
  if (data.length === 0) return;

  const headers = Object.keys(data[0]);
  const csvContent = [
    headers.join(","),
    ...data.map((row) =>
      headers
        .map((header) => {
          const value = row[header];
          const stringValue = value?.toString() || "";
          // Escape quotes and wrap in quotes if contains comma
          return stringValue.includes(",")
            ? `"${stringValue.replace(/"/g, '""')}"`
            : stringValue;
        })
        .join(",")
    ),
  ].join("\n");

  downloadFile(csvContent, filename, "text/csv");
}

// Export to JSON
export function exportToJSON(data: unknown, filename: string): void {
  const jsonContent = JSON.stringify(data, null, 2);
  downloadFile(jsonContent, filename, "application/json");
}

// Helper to download file
function downloadFile(content: string, filename: string, mimeType: string): void {
  const blob = new Blob([content], { type: mimeType });
  const url = URL.createObjectURL(blob);
  const link = document.createElement("a");
  link.href = url;
  link.download = filename;
  document.body.appendChild(link);
  link.click();
  document.body.removeChild(link);
  URL.revokeObjectURL(url);
}

// Format date for reports
export function formatReportDate(date: Date): string {
  return new Date(date).toLocaleDateString("en-US", {
    year: "numeric",
    month: "long",
    day: "numeric",
  });
}

// Format date and time
export function formatReportDateTime(date: Date): string {
  return new Date(date).toLocaleString("en-US", {
    year: "numeric",
    month: "long",
    day: "numeric",
    hour: "2-digit",
    minute: "2-digit",
  });
}

// Generate filename with timestamp
export function generateFilename(
  reportName: string,
  format: ExportFormat
): string {
  const timestamp = new Date()
    .toISOString()
    .replace(/[:.]/g, "-")
    .substring(0, 19);
  const extension = format === "excel" ? "xlsx" : format;
  return `${reportName}_${timestamp}.${extension}`;
}

// Calculate percentage
export function calculatePercentage(value: number, total: number): number {
  if (total === 0) return 0;
  return Math.round((value / total) * 100);
}

// Group data by field
export function groupBy<T>(
  array: T[],
  key: keyof T
): Record<string, T[]> {
  return array.reduce((result, item) => {
    const groupKey = String(item[key]);
    if (!result[groupKey]) {
      result[groupKey] = [];
    }
    result[groupKey].push(item);
    return result;
  }, {} as Record<string, T[]>);
}

// Count occurrences
export function countByField<T>(
  array: T[],
  key: keyof T
): Record<string, number> {
  return array.reduce((result, item) => {
    const fieldValue = String(item[key]);
    result[fieldValue] = (result[fieldValue] || 0) + 1;
    return result;
  }, {} as Record<string, number>);
}

// Calculate average
export function calculateAverage(numbers: number[]): number {
  if (numbers.length === 0) return 0;
  const sum = numbers.reduce((acc, num) => acc + num, 0);
  return Math.round((sum / numbers.length) * 10) / 10;
}

// Sort data by field
export function sortBy<T>(
  array: T[],
  key: keyof T,
  order: "asc" | "desc" = "asc"
): T[] {
  return [...array].sort((a, b) => {
    const aVal = a[key];
    const bVal = b[key];
    
    if (aVal < bVal) return order === "asc" ? -1 : 1;
    if (aVal > bVal) return order === "asc" ? 1 : -1;
    return 0;
  });
}

// Prepare data for CSV export (flatten nested objects)
export function flattenForCSV(data: Record<string, unknown>[]): Record<string, unknown>[] {
  return data.map((item) => {
    const flattened: Record<string, unknown> = {};
    
    Object.entries(item).forEach(([key, value]) => {
      if (value && typeof value === "object" && !Array.isArray(value)) {
        // Flatten nested object
        Object.entries(value as Record<string, unknown>).forEach(([nestedKey, nestedValue]) => {
          flattened[`${key}_${nestedKey}`] = nestedValue;
        });
      } else if (Array.isArray(value)) {
        // Convert array to string
        flattened[key] = value.join("; ");
      } else {
        flattened[key] = value;
      }
    });
    
    return flattened;
  });
}

// Format currency
export function formatCurrency(amount: number): string {
  return new Intl.NumberFormat("en-US", {
    style: "currency",
    currency: "USD",
  }).format(amount);
}

// Get date range label
export function getDateRangeLabel(start: Date, end: Date): string {
  return `${formatReportDate(start)} - ${formatReportDate(end)}`;
}

// Export table to CSV from HTML table element
export function exportTableToCSV(tableId: string, filename: string): void {
  const table = document.getElementById(tableId) as HTMLTableElement;
  if (!table) return;

  const rows = Array.from(table.querySelectorAll("tr"));
  const csvContent = rows
    .map((row) => {
      const cells = Array.from(row.querySelectorAll("th, td"));
      return cells
        .map((cell) => {
          const text = cell.textContent?.trim() || "";
          return text.includes(",") ? `"${text}"` : text;
        })
        .join(",");
    })
    .join("\n");

  downloadFile(csvContent, filename, "text/csv");
}
